    ovulation.setTime(menstrual.getTime() + (cycle * 86400000) - (luteal * 86400000));
    duedate.setTime(ovulation.getTime() + 266 * 86400000);
    var month = duedate.getMonth() + 1;
    month = (month < 10) ? "0" + month : month;
    var day = duedate.getDate();
    day = (day < 10) ? "0" + day : day;
    var year = duedate.getYear();
    if (year < 2000) year += 1900;
    form.get('Estimated date of delivery').setValue(year + "-" + month + "-" + day);
    var fetalage = 14 + 266 - ((duedate - today) / 86400000);
    var weeks = parseInt(fetalage / 7);
    form.get('Number of Weeks').setValue(weeks);
    var days = Math.floor(fetalage % 7);
    form.get('Number of Days').setValue(days);
  }
}"}},{"type":"obsControl","label":{"translationKey":"ESTIMATED_DATE_OF_DELIVERY_15","id":"15","units":"","type":"label","value":"Estimated date of delivery"},"properties":{"mandatory":false,"notes":false,"addMore":false,"hideLabel":false,"controlEvent":false,"location":{"column":0,"row":13}},"id":"15","concept":{"name":"Estimated date of delivery","uuid":"6422a83f-acc6-4953-8239-f18a0b6d90a4","datatype":"Date","conceptClass":"Misc","conceptHandler":null,"answers":[],"properties":{"allowDecimal":null}},"units":null,"hiNormal":null,"lowNormal":null,"hiAbsolute":null,"lowAbsolute":null},{"type":"obsGroupControl","label":{"translationKey":"ESTIMATED_GESTATIONAL_AGE_16","type":"label","value":"Estimated Gestational Age","id":"16"},"properties":{"addMore":false,"location":{"column":0,"row":14}},"id":"16","concept":{"name":"Estimated Gestational Age","uuid":"9e071d37-ee01-4785-a756-7e4059ffe736","datatype":"N/A","conceptClass":"ConvSet","conceptHandler":null,"set":true,"setMembers":[{"name":"Number of Weeks","uuid":"73099ba8-73c7-4427-a973-76fc1e4d4120","datatype":"Numeric","conceptClass":"Misc","conceptHandler":null,"units":null,"hiNormal":null,"lowNormal":null,"hiAbsolute":null,"lowAbsolute":null,"answers":[],"properties":{"allowDecimal":false}},{"name":"Number of Days","uuid":"f887f487-58a2-4429-944c-c2134ea658de","datatype":"Numeric","conceptClass":"Misc","conceptHandler":null,"units":null,"hiNormal":null,"lowNormal":null,"hiAbsolute":null,"lowAbsolute":null,"answers":[],"properties":{"allowDecimal":false}}]},"controls":[{"type":"obsControl","label":{"translationKey":"NUMBER_OF_WEEKS_17","id":"17","units":"","type":"label","value":"Number of Weeks"},"properties":{"mandatory":false,"notes":false,"addMore":false,"hideLabel":false,"controlEvent":false,"location":{"row":0,"column":0}},"id":"17","concept":{"name":"Number of Weeks","uuid":"73099ba8-73c7-4427-a973-76fc1e4d4120","datatype":"Numeric","conceptClass":"Misc","conceptHandler":null,"units":null,"hiNormal":null,"lowN